import styled from 'styled-components'

const StyledAsidePlaylists = styled.div`
	display: flex;
	width: 100%;
	padding: 0 22px 0 17px;
	flex-direction: column;
	border-top: 1px solid var(--panelBorderGray);	
`
export default StyledAsidePlaylists
